// index.js
import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
import { Button, CssBaseline, Container, Typography } from '@mui/material';
import RegistrationForm from './components/Form';
import ExamForm from './components/ExamForm';
import PatientReport from './components/PatientReport';
import './styles.css';

const App = () => {
  return (
    <Router>
      <Container component="main" maxWidth="sm" style={{ textAlign: 'center', display: 'flex', flexDirection: 'column', padding: '3rem', gap: '1rem' }}>
        <CssBaseline />
        <Typography variant="h4" color="primary" gutterBottom>
          Registro de Pacientes
        </Typography>
        <Switch>
          <Route path="/exam" component={ExamForm} />
          <Route path="/patient-report" component={PatientReport} />
          <Route path="/" component={RegistrationForm} />
        </Switch>
        <Button component={Link} to="/exam" variant="contained" color="primary" style={{ marginTop: '20px' }}>
          Clique para registrar um exame
        </Button>
        <Button component={Link} to="/patient-report" variant="contained" color="primary" style={{ marginTop: '20px' }}>
          Verificar relat√≥rio de paciente
        </Button>
      </Container>
    </Router>
  );
};

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
